import React, { Children } from 'react';
import './App.css'
import Botao from './Botao';


import GerarNumeros from './GeradorNumeros.tsx';

interface Props{
  children:string
}


function App(props:Props) {

  const Numeros = Array.from({ length: 25 }, (e, i) => i + 1).sort(() => Math.random() - 0.5).filter((e, i) => i < 15);
        const listaNumeros = Numeros.map((i) => <td>{i}</td>);




  return (
    <div className="App">
      <h1>Gerador de jogos da loto fácil</h1>

      <GerarNumeros />
     <Botao
        key={Children}
     onClick={()=>console.log(listaNumeros)}>
      Gerar Numeros
     </Botao>

    </div>
  );
}

export default App;
